import React from 'react';
import ContenedorHijo from './contenedor-hijo';

class Contenedor extends React.Component {
  render() {
    return (
      <div className="contenedor-padre">
        <ContenedorHijo /> {/* Renderiza el contenedor hijo dentro del contenedor padre */}
      </div>
    );
  }
}

export default Contenedor;
